import React from 'react';
import './Hero.css';
import { BlurIn } from './BlurIn';

const Hero = () => {
  return (
    <section className="hero">
      <div className="hero-content">
        <div className="hero-text">
          <BlurIn className="hero-name" delay={0}>
            Kai Solik
          </BlurIn>
          <BlurIn className="hero-title" delay={0.3}>
            UX/UI Designer
          </BlurIn>
        </div>
      </div>
    </section>
  );
};

export default Hero;
